import React,{userState} from 'react'
import './Login.css'
import login2 from './login2.jpg'
import {useNavigate} from 'react-router-dom'
import axios from 'ax'
export default function Login({name}) {
  const navigate = useNavigate();
  const navigateToreset = () => {
    navigate("/Reset");
  };

  return (
    <div id='mainlogin'>
        <div className='main1'>
          <div className='login-container'>
            <form action=''  name='' className='login-container'>
              <h1>{name}</h1>
              <input type='text' className='input' placeholder='Username or Email' ></input>
              <button className='button' onClick={navigateToreset}>Submit</button>
            </form>
          </div>
        </div>
        <div className='main2'>
          <h1>Welcome Back</h1>
        <img src={login2} alt="Logo" />
        </div>
    </div>
  )
}
